import './main_content.css';


const Intro = () => {

    return (
        <div className="page">
            <div className="page-section">
                <h1>*Logo*</h1>
                <p>Prompt</p>
            </div> 
            <div className="page-section">
                <h1>Overview</h1>
                <p>Description</p>
            </div> 

            <div className="page-section">
                <h1>Vision</h1>
                <p>Description</p>
            </div> 

            <div className="page-section">
                <h1>Team/contributors</h1>
                <p>Description</p>
            </div> 
        </div>
    )


};

export default Intro;
